import "/home/marv/the-odin-project/react-projects/anime-search/src/Leaderboard/leaderboard.css";

export default function LeaderBoard(props) {
  const { lists } = props;

  /* const removeQuotes = string => string.replaceAll("\"", "").replaceAll("{","").replaceAll("}","").replaceAll("[","").replaceAll("]","").replaceAll(",",""); */

  return (
    <div className="leaderboard-wrapper">
      <div className="leaderboard">
        <h1>LEADERBOARD</h1>
        <div className="board-output">
          {lists.map((list) => (
            <div>
            <p key={list.id}><span className="name-color">Name: </span>{list.data.name}</p>
            <p><span className="time-color">Time: </span>{list.data.time}</p>
            </div>
          ))}
          <p>jijij</p>
          <p>jijij</p>
          <p>jijij</p>
          <p>jijij</p>
        </div>
      </div>
    </div>
  );
}
